import React from 'react';
import { createRoot } from 'react-dom/client'; // Правильный импорт

const inputClick = () => console.log("Clicked"); // Обработчик клика
const mouseOver = () => console.log("Mouse Over"); // Обработчик наведения мыши

const helpText = "Help Text"; // Текст помощи

class Header extends React.Component {
  render() {
    return <header>Шапка Сайта</header>; // Компонент Header должен возвращать JSX
  }
}

const App = () => {
  return (
    <div className="name">
      <Header />
      <h1>{helpText}</h1>
      <input placeholder={helpText} onClick={inputClick} onMouseOver={mouseOver} />
      <p>{helpText === "Help Text!" ? "Yes" : "No"}</p>
    </div>
  );
};

const app = createRoot(document.getElementById('app')); 

app.render(<App />);
